import React, { useEffect } from "react";
import { connect } from 'react-redux';

import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableFooter from '@material-ui/core/TableFooter';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import TablePagination from '@material-ui/core/TablePagination';
import { createMuiTheme, ThemeProvider } from '@material-ui/core/styles';
import { ptBR } from '@material-ui/core/locale';

import { find } from '../../redux/client/client.actions';

const theme = createMuiTheme({}, ptBR);

function Clientes({ findClients, data }) {

  useEffect(() => {
    findClients();
  }, [findClients]);

  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(5);

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  };

  return (
    <div className="Clientes">
      <div className="form">

      </div>
      <ThemeProvider theme={theme}>
        <TableContainer component={Paper}>
          <Table className='table'>
            <TableHead>
              <TableRow>
                <TableCell> Nome </TableCell>
                <TableCell> E-mail </TableCell>
                <TableCell> Data de Nascimento </TableCell>
                <TableCell> Sexo </TableCell>
                <TableCell> Celular </TableCell>
                <TableCell> Endereço </TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {data.map((row) => (
                <TableRow key={row.id}>
                  <TableCell component="th" scope="row">
                    {row.name}
                  </TableCell>
                  <TableCell>{row.email}</TableCell>
                  <TableCell>{new Date(row.birthDate).toLocaleDateString()}</TableCell>
                  <TableCell>{row.gender}</TableCell>
                  <TableCell>{row.phone}</TableCell>
                  <TableCell>{row.address}</TableCell>
                </TableRow>
              ))}
            </TableBody>
            <TableFooter>
              <TableRow>
                <TablePagination
                  rowsPerPageOptions={[5, 10, 25, 50]}
                  colSpan={3}
                  count={data.length}
                  rowsPerPage={rowsPerPage}
                  page={page}
                  SelectProps={{
                    inputProps: { 'aria-label': 'registros por página' },
                    native: true,
                  }}
                  labelRowsPerPage="Registros por página"
                  onChangePage={handleChangePage}
                  onChangeRowsPerPage={handleChangeRowsPerPage}
                />
              </TableRow>
            </TableFooter>
          </Table>
        </TableContainer>
      </ThemeProvider>
    </div >
  );
};

const mapStateToProps = (state) => {
  return {
    data: state.client.data
  };
}

const mapDispatchToProps = dispatch => ({
  findClients: item => dispatch(find())
});


export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Clientes);
